export const SESSION_STORE_GET_WHATSAPP_SESSION = 'sessionStore/getWhatsappSession';
export const SESSION_STORE_SET_WHATSAPP_SESSION = 'sessionStore/setWhatsappSession';

export default {
    namespaced: true,
    state: {
        whatsappSession: {
            //Foto en base 6 JL
            user: {
                photo: ""
            }
        }
    },
    mutations: {
        SET_WHATSAPP_SESSION(state: any, whatsappSession: Object) {
            state.whatsappSession = whatsappSession;
        }
    },
    actions: {
        setWhatsappSession({commit}: any, whatsappSession: boolean) {
            commit('SET_WHATSAPP_SESSION', whatsappSession);
        }
    },
    getters: {
        getWhatsappSession(state: any) {
            return state.whatsappSession;
        }
    }
}